import React, { useState } from 'react'
import logo from './logo.svg';
import { language } from './utils/utils';

function App() {

  const [score, setScore] = useState(0);

  return (
    <div className='w-full h-screen grid bg-slate-700 p-2  justify-center'>
      <div className='w-2xl h-max p-2 flex gap-24 rounded-lg border-4 border-slate-500 items-center'>
        <img src={logo} className="w-36 h-24" alt="logo" />
        <div className='w-full h-max px-10 py-6 bg-white grid rounded-lg items-center justify-center'>
          <span className='w-full align-center text-blue-700 text-xl'>{language.includes("tr")?"Skor":"Score"}</span>
          <span className='w-full align-center text-slate-700 text-3xl'>{score}</span>
        </div>
      </div>

    </div>
  )
}

export default App
